import React, { Component, Fragment } from "react";
import { CssBaseline, withStyles } from "@material-ui/core";

import { Header, Footer } from "./Layout/index";
import Discs from "./Discs/Discs";

class App extends Component {
  render() {
    return (
      <Fragment>
        <CssBaseline />
        <Header />
        <Discs />
      </Fragment>
    );
  }
}

export default App;
